    return (
        <>
            <Grid container direction='column' className={root} justifyContent="center" alignItems="center">
                <Grid item>
                    <Avatar style={{backgroundColor: 'black', height: 40, width: 40}} src='https://airportshuttle0.s3.amazonaws.com/defaultAvatar.png' />
                </Grid>
                    <Typography variant="h5">Ahmed felfel</Typography>
                    <Typography variant="body2">cep 009035124785</Typography>
                    <Typography variant="body2">car No:  009035124785</Typography>

            </Grid>
        </>
    )
};

export default DriverDetail;
